import { Icon } from 'antd';


const GithubLinkIcon = () => {
  return (
    <div className="github-icon">
      <a link="https://github.com/">
        <Icon type="github" />
      </a>
      <style jsx>
        {`
          .github-icon {
            margin-rught: 16px;
            color: #fff;
          }
        `}
      </style>
    </div>
  )  
}

export default GithubLinkIcon
